import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import '../estilos-todos.css';
import logoCentral from '../elements/imagenes/logo-central.svg';

export const Inicio = () => {
    return (
        <div className='fondo'>
            <img src={logoCentral} className="logo-principal" alt="logo" />
        </div>
    )
}
